export type TIconProp = {
  icon: keyof typeof iconList | undefined;
  color?: string;
};

export default function Icons({ icon = "logo", color }: TIconProp) {
  if (color === "none") color = undefined;
  if (!icon) return <div>Unknown Icon</div>;
  return <>{iconList[icon](color)}</>;
}
